import React, { useState } from 'react';
import { render } from 'react-dom';
import { TableContainer, Table, TableHead, TableBody, TableRow, TableCell, IconButton, Dialog, DialogTitle, DialogContent, DialogContentText, Button, TextField } from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';
import EditIcon from '@mui/icons-material/Edit';
import AddIcon from '@mui/icons-material/Add';

const dummyData = [
  { id: 1, name: 'John', age: 30, email: 'john@example.com' },
  { id: 2, name: 'Doe', age: 25, email: 'doe@example.com' },
  { id: 3, name: 'Jane', age: 35, email: 'jane@example.com' },
];

const MyTable = () => {
  const [data, setData] = useState(dummyData);
  const [editDialogOpen, setEditDialogOpen] = useState(false);
  const [addDialogOpen, setAddDialogOpen] = useState(false);
  const [deleteDialogOpen, setDeleteDialogOpen] = useState(false);
  const [selectedId, setSelectedId] = useState(null);
  const [editedData, setEditedData] = useState({});
  const [newData, setNewData] = useState({});

  const handleEditClick = (id) => {
    const selectedRow = data.find((item) => item.id === id);
    setEditedData(selectedRow);
    setSelectedId(id);
    setEditDialogOpen(true);
  };

  const handleAddClick = () => {
    setAddDialogOpen(true);
  };

  const handleDeleteClick = (id) => {
    setSelectedId(id);
    setDeleteDialogOpen(true);
  };

  const handleEditSave = () => {
    setData((prevData) =>
      prevData.map((item) => (item.id === selectedId ? editedData : item))
    );
    setEditDialogOpen(false);
  };

  const handleAddSave = () => {
    const id = data.length + 1;
    setData([...data, { ...newData, id }]);
    setAddDialogOpen(false);
  };

  const handleDeleteConfirm = () => {
    setData((prevData) => prevData.filter((item) => item.id !== selectedId));
    setDeleteDialogOpen(false);
  };

  return (
    <>
      <TableContainer>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Name</TableCell>
              <TableCell>Age</TableCell>
              <TableCell>Email</TableCell>
              <TableCell>Action</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {data.map((row) => (
              <TableRow key={row.id}>
                <TableCell>{row.name}</TableCell>
                <TableCell>{row.age}</TableCell>
                <TableCell>{row.email}</TableCell>
                <TableCell>
                  <IconButton onClick={() => handleEditClick(row.id)}>
                    <EditIcon />
                  </IconButton>
                  <IconButton onClick={() => handleDeleteClick(row.id)}>
                    <DeleteIcon />
                  </IconButton>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>

      {/* Edit Dialog */}
      <Dialog open={editDialogOpen} onClose={() => setEditDialogOpen(false)}>
        <DialogTitle>Edit Data</DialogTitle>
        <DialogContent>
          <DialogContentText>Edit the data fields:</DialogContentText>
          <TextField
            label="Name"
            value={editedData.name || ''}
            onChange={(e) =>
              setEditedData({ ...editedData, name: e.target.value })
            }
          />
          <TextField
            label="Age"
            value={editedData.age || ''}
            onChange={(e) =>
              setEditedData({ ...editedData, age: e.target.value })
            }
          />
          <TextField
            label="Email"
            value={editedData.email || ''}
            onChange={(e) =>
              setEditedData({ ...editedData, email: e.target.value })
            }
          />
          <Button onClick={handleEditSave}>Save</Button>
        </DialogContent>
      </Dialog>

      {/* Add Dialog */}
      <Dialog open={addDialogOpen} onClose={() => setAddDialogOpen(false)}>
        <DialogTitle>Add New Entry</DialogTitle>
        <DialogContent>
          <DialogContentText>Enter the new data:</DialogContentText>
          <TextField
            label="Name"
            value={newData.name || ''}
            onChange={(e) =>
              setNewData({ ...newData, name: e.target.value })
            }
          />
          <TextField
            label="Age"
            value={newData.age || ''}
            onChange={(e) =>
              setNewData({ ...newData, age: e.target.value })
            }
          />
          <TextField
            label="Email"
            value={newData.email || ''}
            onChange={(e) =>
              setNewData({ ...newData, email: e.target.value })
            }
          />
          <Button onClick={handleAddSave}>Add</Button>
        </DialogContent>
      </Dialog>

      {/* Delete Confirmation Dialog */}
      <Dialog
        open={deleteDialogOpen}
        onClose={() => setDeleteDialogOpen(false)}
      >
        <DialogTitle>Delete Confirmation</DialogTitle>
        <DialogContent>
          <DialogContentText>
            Are you sure you want to delete this record?
          </DialogContentText>
          <Button onClick={handleDeleteConfirm}>Confirm</Button>
          <Button onClick={() => setDeleteDialogOpen(false)}>Cancel</Button>
        </DialogContent>
      </Dialog>

      {/* Add Button */}
      <IconButton onClick={handleAddClick}>
        <AddIcon />
      </IconButton>
    </>
  );
};

export default MyTable;
